import React, { Component } from 'react'

export default class Output extends Component {
    render() {
        return (
            <div>
                <h2> Operan props : {this.props.makanan} </h2>
                <button onClick={() => this.setState({makanan: 'Soto'})}>Ganti</button>
            </div>
        )
    }
}
